 p_id=>wwv_flow_imp.id(19246929743268224305)
,p_plug_name=>'Ciecia'
,p_region_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_imp.id(19246716927069224100)
,p_plug_display_sequence=>10
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    k.imie,',
'    k.nazwisko,',
'    k.numer_telefonu,',
'    c.id_blatu,',
'    c.pozycja_x AS wymiar_x_wycinka,',
'    c.pozycja_y AS wymiar_y_wycinka,',
'    s.dlugosc AS "dlugosc_blatu_z_magazynu",',
'    s.szerokosc AS "szerokosc_blatu_z_magazynu"',
'FROM ',
'    ciecia c',
'LEFT JOIN ',
'    surowce s ON c.id_blatu = s.id_blatu',
'LEFT JOIN ',
'    historia_ciec hc ON c.id_ciecia = hc.id_ciecia',
'LEFT JOIN ',
'    pozycje p ON hc.id_pozycji = p.id_pozycji',
'LEFT JOIN ',
'    klienci k ON p.id_klienta = k.id_klienta;'))
,p_plug_source_type=>'NATIVE_IR'
,p_prn_page_header=>unistr('Wykonane ciecia dla klient\00F3w')
